import React from 'react';
import { Link } from 'react-router-dom';
import { Nav, Navbar } from 'react-bootstrap';
import '../style/index.css';

class Navbars extends React.Component {
  render() {
    return (
      <div>
        <Navbar bg="dark" variant="light">
          <Navbar.Brand>
            <Link to="/" className="mainLink">疫情狀態</Link>
            </Navbar.Brand>
          <Nav className="mr-auto">
            <Link className="link" to="/about" href="#"><i className="fas fa-head-side-mask"></i>關於Covid-19</Link>
            <Link className="link" to="/maskmap">口罩地圖</Link>
            <Link className="link" to="/hospital">附近醫療資源</Link>
            <Link className="link" to="/donate">捐款</Link>
          </Nav>
        </Navbar>
      </div>
    );
  }
}

export default Navbars;
